import React from 'react';
import StockPopup from '../components/streams/StockPopup';
import { connect } from 'react-redux';
import { getStocks } from '../actions';

{/* <Popup trigger={<button>Buy Stocks</button>} position="right center">
<StockPopup/>
</Popup> */}
class Deposits extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      date: [],
      open: [],
      high: [],
      low: [],
      close:[],
      adjustedclose:[],
      volume:[],
      divident:[],
      coefficient:[]

    };
  }    
  componentDidMount(){
    this.props.getStocks(this.props.currentCompany);
  }


  render(){
    return (
        <div></div>
      );
  }
}

const mapStateToProps = (state) => {
  return {
    companies:state.stocks.companyInfo,
    currentCompany:state.stocks.currentCompany
  };
};

export default connect(
  mapStateToProps,
  { getStocks }
)(Deposits);
